let items = $input.all();

if (!Array.isArray(items)) {
    items = [items];
}

const processados = [];

for (const item of items) {
  const dados = item.json || item;

  if (!dados) continue;

  // 1. Filtrar apenas quem tem Certificar = SIM
  const certificar = (dados.Certificado || dados.Certificar || dados.certificado || dados.certificar || '').toString().toUpperCase();

  if (certificar !== 'SIM') continue;

  // 2. Formatar Nome
  let nome = (dados.Nome || dados.nome || '').toString();
  nome = nome.toUpperCase()
    .replace(/COPY/gi, '')
    .replace(/\s+/g, ' ')
    .trim();

  // 3. Formatar CPF
  let cpf = (dados.CPF || dados.cpf || '').toString().replace(/\D/g, '');
  cpf = cpf.padStart(11, '0');
  cpf = cpf.replace(/(\d{3})(\d{3})(\d{3})(\d{2})/, '$1.$2.$3-$4');

  // 4. Formatar Telefone
  let telefone = (dados.Telefone || dados.telefone || '').toString().replace(/\D/g, '');

  // Garantir código do país +55 para Brasil
  if (telefone && !telefone.startsWith('55')) {
    telefone = '55' + telefone;
  }

  // 5. Email
  let email = (dados.Email || dados.email || dados['E-mail'] || dados['e-mail'] || '').toString().trim().toLowerCase();

  // 6. Push para o Array Final
  if (nome && email) {
    processados.push({
      json: {
        nome: nome,
        cpf: cpf,
        telefone: telefone,
        email: email,
        data_geracao: new Date().toISOString().split('T')[0]
      }
    });
  }
}

return processados;
